import React from "react";
// import { ReactPropTypes } from "react";

export default function MovieCards(props) {
    return (
        <>
            <div className="card" style={{border:'2px solid red',width: "300px",height:"100%"}}>
                <img style={{width:"300px"}} src={`https://image.tmdb.org/t/p/original${props.image}`} className="card-img-top" alt={props.title}/>
                    <div className="card-body">
                        <p className="card-text">{props.text}</p>
                    </div>
            </div>
        </>
    )
}
